allow a third party to impersonate you.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You agree as consideration for any purchase you make on or through the Website to pay the purchase price and all applicable fees and taxes to us. You consent to us or our third party payment processors, and/or merchants authorising your credit card, debit card, bank account, e-wallet or other approved payment facility or method for the full payment of the purchase price and all applicable fees and taxes.&nbsp;</span><span style=\"font-size:15px;color:black;\">The purchase price of the Products listed on the Website are inclusive of delivery costs unless indicated otherwise. &nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">Should your order not meet our minimum order requirements, we reserve the right to charge you an additional fee at check out or to cancel your order on written notice to you and credit your account in the amount paid.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">No payment shall be deemed to have been received until we have received cleared funds into our selected bank account, e-wallet or Cash on delivery. Purchases made on credit shall be approved by us and paid by you in accordance with the terms and conditions of credit agreed by us and you (&ldquo;<strong>Credit Agreement</strong>&rdquo;).&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">Without prejudice to any other right or remedy we may have herein or at law; we reserve the right to commence legal proceedings to recover any unpaid monies owing by you to us (including payments made or processed but reversed by your credit card company or processing bank) for any purchase of the Products and/or Services.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You agree that in order to complete your purchase you will be required to provide personal information which may include but not be limited to your full name, delivery address, email address, payment details and billing information and that your personal information may be collected by us and third party payment processing companies and/or merchants. You further agree that all information provided in connection with your purchase of the Products and/or Services is complete, current and accurate and may be relied on by us and third-party payment processors and merchants.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You understand that when you purchase the Products and/or Services made available on our Website you may &nbsp;be subject to the additional terms and conditions and privacy policies of payment processing companies and/or merchants and that it is your responsibility to visit their websites and review their terms and conditions and privacy policies. We shall not be liable for loss, damage, refunds, disputes or any other matters arising out of or in connection with your dealings with payment processing companies and/or merchants.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>Your receipt of an electronic or other form of order confirmation does not signify our acceptance of your order, nor does it constitute confirmation of our offer to sell any Product and/or Service to you. We reserve the right at any time after receipt of your order to require additional verification or information from you and to accept or decline your order in our sole discretion. Further, we reserve the right at any time after receipt of your order, without prior notice to you, to</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>&nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>supply less than the quantity you ordered of any item</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>, in which case your account shall be credited with the difference in quantity ordered and supplied</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>In the event that a Product and/or Service is listed on the Website or any other website/application in Mnandi retail solutions possession at an incorrect price or with incorrect information, or if the price has increased or decreased between the time the Product is placed in a shopping trolley and the time that the purchase is actually made, we shall have the right to refuse or cancel any orders placed, irrespective of whether your order has been confirmed and you have been charged. If you have been charged for the purchase and your order is cancelled, we will credit your account in the amount of the charge.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>If there is any dispute about the exact purchase price payable by you to us, the purchase price for the Products and/or Services shall be determined by us in our sole discretion in accordance with our standard product list purchase price for the Products and/or Services or similar Products and/or Services made available by us on the date of purchase.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">The Products and/or Services are supplied on an &quot;as is&quot; basis and have not been supplied to meet your specific requirements. It is your responsibility to satisfy yourself prior to purchasing the Products and/or Services that they will meet your requirements. &nbsp;&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">Neither us, nor any of our agents, officers, subsidiaries, affiliates, partners, successors, assigns, directors, shareholders, service providers, resellers, distributors, contractors, suppliers, employees, representatives, payment processing companies or merchants (&ldquo;<strong>Ancillary Parties</strong>&rdquo;) shall be liable for any loss or damage arising out of or in connection with your purchase of the Products and/or Services made available on the Website and you hereby indemnify us and our Ancillary Parties against any and all claims, actions, applications and demands accordingly.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:1.0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:12.0pt;margin-bottom:12.0pt;text-align:justify;text-indent:-1.0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Delivery of Products and Services&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Save in the instance when you select the ex-factory delivery option, Products shall be delivered to the physical address in the Territory selected by you at checkout. We shall not be liable for loss or damage of any nature whatsoever and howsoever arising once the Products are handed to the service provider attending to delivery by railage and/or cartage or by any other means or mode of delivery or to you or your representative as the case may be at the address provided for delivery.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Should you select the ex-factory delivery option at checkout and prior to the delivery date, notify us that you require delivery of the Products and/or Services to a physical address in the Territory, we reserve the right to cancel your order or delivery the Products and/or Services to you subject to payment of all applicable delivery and administration fees notified by us to you.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Where your preferred delivery address does not fall within the Territory, you will be required at your sole costs and expense to collect your order from our factory on the delivery date. <span style=\"background:white;\">In the event that you collect your order from our factory, you shall provide, at your own costs and expense, adequate and appropriate equipment and labour for transporting and off-loading the Products.</span></span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>Delivery fees may change due to increases in the price of postage, fuel, or any other material or service utilised to fulfil your order. As delivery fees are included in the purchase price of the Products and/or Services (unless indicated otherwise), increases in delivery fees may result in increases in the purchase price of the Products and/or Services from time to time.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Where a delivery date is specified, reasonable effort will be made to despatch the Products and/or Services within the stated period. We, however, reserve our right to amend the delivery date and quantities delivered in our sole discretion or if circumstances beyond our reasonable control make it necessary to do so. We do not warrant, represent or guarantee that the Products will be delivered on the due date for delivery notified to you (or selected by you at checkout) or that we will have sufficient stock to fulfil your order.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>We may effect delivery of any of the Products and/or Services in instalments at different times on different delivery dates and you shall accept delivery in instalments as we may determine. <span style=\"background:white;\">Each instalment shall be a separate agreement to these Terms and no cancellation or termination of any one agreement to these Terms relating to an instalment shall entitle you to repudiate or cancel any other agreement to these Terms.</span></span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>You agree to ensure that you or your</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>employees, officers, agents or authorised representatives (&ldquo;</span><strong><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Representatives</span></strong><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&rdquo;)&nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>are present to accept delivery of the Products and/or Services on the delivery date and warrant the authority of your Representatives to accept delivery and sign delivery notes and any other ancillary documents (&ldquo;<strong>Delivery Documents</strong>&rdquo;).&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Your signature or the signature of your Representatives on our Delivery Documents or the Delivery Documents of the carrier instructed to deliver the Products and/or Services to you will constitute conclusive evidence of delivery and receipt of the Products and/or Services by you.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>In order for us to take the necessary steps to investigate any non-delivery of the Products and/or Services in a timely manner, you shall be required to notify us in writing of non-delivery within 5 (five) business days of the anticipated date of delivery, failing which, you shall forfeit any claim you may have against us or our Ancillary Parties arising out of or in connection with the non-delivery of the Products and/or Services.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Upon collection from our factory or delivery to your chosen address in the Territory (as applicable) and prior to accepting delivery and signing the Delivery Documents, you shall&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:44px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>inspect the Products and/or Services:</span>\r\n        <ol style=\"list-style-type: lower-alpha;\">\r\n            <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>as to quality and defects (including but not limited to defects in packaging);</span></li>\r\n            <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>to ensure that all Products have readable barcodes and expiry dates; and</span></li>\r\n            <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>to ensure that the Products and/or Services ordered have been delivered to you.&nbsp;</span></li>\r\n        </ol>\r\n    </li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>notify us of any defects and/or errors, failing which, the Products and/or Services shall be deemed to have been delivered in good order and condition and in accordance with your order requirements.&nbsp;</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:54.0pt;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;margin-top:0cm;margin-bottom:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Defects that cannot reasonably be expected to be visible on delivery, shall be notified to us in writing upon discovery and in any event, by no later than 5 (five) business days from the date of delivery. &nbsp;Defects and/or errors notified to us on delivery or in the case of defects that cannot reasonably be expected to be visible on delivery, within 5 (five) business days of delivery, shall be investigated by us within a reasonable time and in the case of justified and timely notice or claims, we will, in our sole discretion, either redeliver the Products to you or credit your account with us.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<pre style=\"margin:0cm;font-size:13px;font-family:Consolas;text-align:justify;background:white;\"><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Under no circumstances shall we accept Products and/or Services returned due to: </span></pre>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:44px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>damage to the Products and/or their packaging caused by you or your Representatives;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>the Products having expired (save where the expiry date precedes the delivery date);</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>infestation due to storage in poor facilities post-delivery;&nbsp;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>water damage incurred post-delivery; and</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;color:black;\'>any other reason we may reasonably determine in our sole discretion.</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Products that have been delivered may not be returned without our prior written consent. <span style=\"background:white;\">If we agree to accept any return of the Products and/or Services, you shall be liable to pay all costs and expenses in order to effect the return including but not limited to a reasonable handling fee determined by us in or sole discretion and all transportation, insurance and other costs and expenses incurred in respect of packaging so that the Products may be in a condition suitable for resale.</span></span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>If for any reason you fail to accept delivery of the Products you have ordered and paid for, or we are unable to deliver the Products on time due to the fact that you have not provided appropriate instructions, documents, authorisation, access or off-loading or storage facilities:</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'><br> <span style=\"background:white;\">i)&nbsp;the Products shall be deemed to have been delivered;</span><br> <span style=\"background:white;\">ii)<strong>&nbsp;</strong>any and all risk in and to the Products shall pass to you; and</span><br> <span style=\"background:white;\">iii) we may store the Products until delivery takes place, whereupon you shall be liable for all related costs and expenses including but not limited to storage, maintenance, insurance and transportation.</span></span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;background:white;\'>If you are authorised to make payment on delivery, whether by e-wallet or otherwise and you fail to make payment on delivery:</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'><br> <span style=\"background:white;\">i)<strong>&nbsp;</strong>ownership of the products shall not pass to you; and</span></span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>ii) the Products shall be returned to us and we shall be entitled to cancel these Terms and recover from you on demand all direct, indirect, special and/or consequential loss and/or damage (including but not limited wasted transportation and insurance costs and expenses) arising out of or in connection with your failure to make payment in accordance with these Terms.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Without prejudice to any of our rights contained herein or at law, should there be any delay between a request in writing by us to you, for any documentation or information required by us to perform our obligations herein and the provision by you of such documentation or information, any time limit set herein on us shall be extended automatically by the length of the said delay.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;\'><strong><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Risk and Title</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Ownership of the Products shall not pass to you until we have received payment in full (in cleared funds) for all sums due to us in respect of the Products and/or Services and all other sums which are or which become due to us from you on any account.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Risk transfers to you upon delivery of the Products or in the event of your <span style=\"background:white;\">failure to accept delivery of the Products and/or Services, or in the event that we are unable to deliver the Products and/or Services to you on time due to a failure by you to provided appropriate instructions, documents and/or authorisation.</span>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Until Ownership of the Products has passed to you, you undertake:</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:44px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>to hold the Products on a fiduciary basis on our behalf;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>to maintain and preserve the Products in their original delivered packaging,&nbsp;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>to store the Products at your expense in such a