an style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Should the Consumer Protection Act No. 68 of 2008 (&ldquo;<strong>CPA</strong>&rdquo;) be applicable to your purchase of the Products and/or Services, and you purchase the Products and/or Services as a result of direct marketing, you shall be entitled to cancel these Terms on written notice within a period of 5 (five) business days from the date of purchase or delivery of the Products and/or Services (&ldquo;<strong>Cooling-off Period</strong>&rdquo;).&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>In the event of cancellation during the Cooling-off Period prior to delivery of the Products and/or Services, we shall credit your account or refund you the amount paid to us for the Products and/or Services within 15 (fifteen) business days of receipt of notice of cancellation.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>In the event of cancellation during the Cooling-off Period after delivery of the Products and/or Services:</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:44px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>Upon return of the Products and/or Services purchased by you, we shall credit your account with the amount paid by you for the Products and/or Services, less any cancellation fees, costs, expenses and damages that we are entitled to recover in accordance with the provisions of the CPA (&ldquo;<strong>Deductions</strong>&rdquo;); or</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>Subject to applicable Deductions, where the Products returned to us are in the original unopened packaging, we will not charge you any amount in respect of the Products. If the Products are in their original condition and repackaged in their original packaging, we may charge you Deductions as well as a reasonable fee for any consumption or depletion of the Products (&ldquo;<strong>Consumption Costs</strong>&rdquo;), save where the consumption or depletion was reasonably necessary to determine whether the Products were acceptable to you; or</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>Where Products returned to us are not in their original packaging or have not been repackaged in their original packaging, we may charge you Deductions, Consumption Costs and all reasonable repackaging and restocking costs and expenses.&nbsp;</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Any and all delivery, transportation, insurance, labour, off-loading and other costs and expenses incurred by you in returning the Products and/or Services to us during the Cooling-off Period shall be for your account and at your sole risk.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><strong><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;border:none windowtext 1.0pt;padding:0cm;\'>Force Majeure</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>In the event of force majeure, we shall be entitled to suspend deliveries without judicial intervention or compensation to you. In addition to what the law considers to be force majeure, force majeure should be understood to mean acts of God, strikes, labour unrest, lockouts, riots, defaults or delays on the part of our suppliers, acts of war, epidemics, boycotts, embargos, sanctions, fire and explosions, communication line failures, power failures, earthquakes, floods and similar disasters, illness of our employees or the employees of our third party service providers, measures taken and/or prohibitions issued by the government, unforeseen and unpredictable traffic impediments, accidents, unforeseen technical defects in our means of transport, as well as all other causes or unforeseen circumstances beyond our reasonable control that prevent us from complying with these Terms properly and/or on time.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;background:white;vertical-align:baseline;\'><span style=\'font-size:15px;