-type: decimal;margin-left:44px;\">\r\n    <li><span style=\"font-family:Arial;color:black;color:black;\">the safety of the Products and/or Services;</span></li>\r\n    <li><span style=\"font-family:Arial;color:black;font-weight:normal;font-size:15px;color:black;\">that the Products and/or Services will be defect free or that defects will be corrected; and</span></li>\r\n    <li><span style=\"font-family:Arial;color:black;font-weight:normal;font-size:15px;color:black;\">that you will attain any particular outcome or result from your purchase or use of the Products and/or Services.</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin-top:0cm;margin-bottom:6.0pt;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;\'>You, your employees, agents and representatives warrant that:</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:44px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:15px;\'>you will comply with the provisions of relevant legislation, including but not limited to, the Financial Intelligence Centre Act 38 of 2001 (as amended), which are applicable to your use and/or purchase of the Products and/or Services;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:15px;\'>you have the necessary consents and approvals required to purchase the Products and/or Services; and</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:15px;\'>you will take all reasonable steps to ensure compliance with the warranties contained herein.&nbsp;</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:1.0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:12.0pt;margin-bottom:12.0pt;text-align:justify;text-indent:-1.0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Accuracy of Information</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You understand and agree that the information and content contained on our Website may change from time to time without notice and that our Website may not always contain the correct or most up-to-date information, details and descriptions.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">While all reasonable effort has been made to ensure the accuracy of the information and content</span><span style=\"font-size:15px;color:black;\">&nbsp;made available, particularly in relation to the Products and Services,&nbsp;</span><span style=\"font-size:15px;color:black;\">we do not guarantee the accuracy of the content or any information provided on our Website.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">For the avoidance of doubt, we shall have the right to increase the prices of our Products and/or Services from time to time by such amounts as we in our sole discretion deem necessary.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><strong><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Termination:</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>We may terminate these Terms&nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>with immediate effect by giving you written notice</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;of termination&nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>upon the occurrence of any of the following events:</span></p>\r\n<ol style=\"list-style-type: decimal;margin-left:96.65px;\">\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>if you are placed in liquidation, whether provisional or final and whether voluntary or compulsory, or under business rescue, whether provisional or final, or should there be an application made against you for such an order or should you convene a meeting of shareholders for the purpose of passing a resolution to be wound up, or you attempt to effect a compromise with your creditors or any other arrangements with your creditors necessitated by or attributable to you being unable to pay your debts, or being an individual, be sequestrated or should any judgment be obtained against you and not be satisfied immediately;</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>should you commit a material breach of any of these Terms,&nbsp;</span><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>&nbsp;any documents we incorporate herein by reference, our</span><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>&nbsp;Website Terms and Conditions or Privacy Policy; or</span></li>\r\n    <li><span style=\'font-family:\"Arial\",sans-serif;font-size:11.0pt;color:black;\'>if your business is transferred in whole or in part, discontinued, or relocated to a different jurisdiction.</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:106.65pt;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;text-align:justify;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>The termination rights granted herein are without prejudice to any other rights and remedies each party may have at law. &nbsp;</span><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>If these Terms are terminated in accordance with the provisions contained herein all indebtedness of one party to the other shall become immediately due and payable on the date of termination.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>A certificate issued and signed by a director or duly authorised manager, whose authority need not be proven by us, stating the amount owing by you to us shall be proof in the first instance (prima facie) of the facts stated therein and may be used in any legal proceedings.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:12.0pt;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Assignment&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:12.0pt;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;font-weight:normal;\">These Terms and any rights granted herein may not be transferred or assigned by you but may be assigned by us without restriction. Any assignment or transfer by you without our prior written consent shall be null and void.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Violation of Terms</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:15px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;line-height:normal;\'><span style=\"color:black;\">Please report any violations of these Terms including any documents incorporated by reference that you become aware of by contacting us at&nbsp;</span><span style=\"color:black;\">info@mnandiretail.com</span><span style=\"color:black;\">&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:12.0pt;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Interpretation and Dispute Resolution&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">These Terms including any documents incorporated by reference and the relationship between us and you shall be governed and construed in accordance with the laws of the Republic of South Africa.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You agree&nbsp;</span><span style=\"font-size:15px;color:black;background:white;\">to notify us of any issues or dissatisfaction that arises via e-mail correspondence prior to taking any legal action. Should we be unable to seek resolution within a reasonable time, you agree that the dispute shall be finally resolved through arbitration, before a single arbitrator, in accordance with the</span><span style=\"font-size:15px;color:black;\">&nbsp;</span><span style=\"font-size:15px;color:black;background:white;\">Arbitration Act, 1965 and the Commercial Arbitration Rules of the Arbitration Foundation of South Africa</span><span style=\"font-size:15px;color:black;\">.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">We shall jointly appoint and agree on the arbitrator but failing agreement between us within 10 (ten) business days of the arbitration being demanded, we shall appoint the arbitrator in our sole discretion.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">The arbitration shall be held in Johannesburg, South Africa and the parties shall endeavor to ensure that it is completed as expediently as possible without delay after notice requiring the dispute to be referred to arbitration is given or demanded.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">You agree that you shall not unduly delay, frustrate or fail to take action to progress or complete the arbitration proceedings.&nbsp;</span><span style=\"font-size:15px;color:black;\">The arbitrator shall have the power to give default judgement if any party fails to make submissions on due date and/or fails to appear at the arbitration.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">The ruling of the arbitrator, in the absence of manifest error, shall be final and binding on the parties and the party in whose favour the award is granted&nbsp;</span><span style=\"font-size:15px;color:black;background:white;\">shall be entitled to all reasonable fees (including attorney fees) and the costs necessary to enforce the decision of the arbitrator.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">In the event of a dispute, you agree not to engage in or be responsible for any defamatory, harmful, negative or disruptive behaviour or communications that could adversely affect us, our Products and/or Services, Website, business or good will in any manner whatsoever. &nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>These Terms contain the entire agreement between us and you. No representation, warranty, disclosures, prior oral agreement or expressions of opinion which are not contained herein shall be valid and binding.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>No variation, amendment, addition or cancellation of these Terms, shall be binding or have any force or effect, unless reduced to writing and signed by or on behalf of us and you.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">Our failure to exercise or enforce any right or provision of these Terms shall not constitute a waiver of such right or provision, nor will it</span><span style=\"font-size:15px;color:black;\">&nbsp;affect any of our accrued rights or liabilities nor the coming into or continuance in force of any provision of these Terms which is expressly or by implication intended to come into or continue in force on or after termination of these Terms.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;\'><span style=\"font-size:15px;color:black;\">If any&nbsp;</span><span style=\"font-size:15px;color:black;\">provision of these Terms is or becomes illegal, invalid or unenforceable such provisions shall be ineffective to the extent of such prohibition or unenforceability and shall be treated as having not been written and severed from the balance of these Terms, without invalidating the remaining provisions of these Terms.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:normal;font-weight:bold;\'><span style=\"font-size:15px;color:black;\">Contact</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:15px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;line-height:normal;\'><span style=\"color:black;\">If you have questions about these Terms, or any documents incorporated by reference herein, please contact us at info@mnandiretail.com</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Times New Roman\",serif;margin:0cm;\'><span style=\'font-size:15px;font-family:\"Arial\",sans-serif;color:black;\'>Last updated: 2021/03/23</span></p>', 0, 0, '2021-03-23 06:13:37');
