(2, 'About Us', 'about-us', '\r\nWEBSITE TERMS AND CONDITIONS\r\nPlease read these terms and conditions before using this website as your use of this\r\nwebsite for any reason whatsoever will mean that you have voluntarily accepted these\r\nterms and conditions\r\nApplication of Terms and Conditions\r\nMnandi Retail Solution (Proprietary) Limited (\"we\", our\" or \"us\") welcome you to our website\r\nwww.mnandisolutions.com (\"Website\") or any other website/application hosted by Mnandi\r\nRetail Solution.\r\nThese terms and conditions (\"Terms\") apply to any person (hereinafter referred to as \"you\" or\r\n\"your\") who uses, accesses or views, the information, content, material, images and intellectual\r\nproperty (\"Content\") made available by us on or through the Website or sent to you via email\r\nfrom the Website.\r\nIf you purchase our products and/or services you will in addition to these Terms, be subject to\r\nour Terms of Purchase and any additional policies or documents incorporated therein by\r\nreference.\r\nYour Agreement to These Terms\r\nThe Website is only intended for individuals aged 18 (eighteen) years or older. By accessing\r\nand/or using the Website you agree and warrant that you are 18 years or older, have reached\r\nthe age of majority in your jurisdiction and are legally competent to enter into this agreement\r\nand abide by these Terms.\r\nThese Terms may be updated or amended by us at any time in our sole discretion. Each time\r\nyou access and/or use the Website, it is your responsibility to review these Terms and our\r\nPrivacy Policy in the event that updates, or amendments have been made.\r\nIf you do not agree with any term or condition in these Terms, or any policies or additional\r\ndocuments we incorporate by reference or become dissatisfied with us, the Website or our\r\nPrivacy Policy, you must not continue to use the Website.\r\nYour Use of the Website\r\nYou may not use the Website to obtain or distribute material containing viruses or any other\r\ndestructive materials or data or code which is able to corrupt, interfere with, jeopardise, disrupt,\r\ndisable, harm or otherwise impede in any manner the operation of a computer system or\r\nhardware or software or the functionality or operation of any part of the Website and Content.\r\nYou are strictly prohibited from using the Website for \"spoofing\", \"hacking\", \"flaming\", \"cracking\",\r\n\"phishing\" or \"spamming\" or any other activity designed or aimed at achieving purposes similar\r\nor the same as the aforementioned acts.\r\nYou shall not intercept any information transmitted to or from us or the Website which is not\r\nintended by us to be received or used by you, and you shall be responsible for all electronic\r\ncommunications, information and content sent by you from any computer or electronic device to\r\nus, which for the avoidance of doubt will be sent at your own risk.\r\nSubject to the further provisions of these Terms\r\n1) the Website and Content may only be used by you for lawful purposes and shall not extend to\r\nthe use of the source code of the Website and Content;\r\n2) you may not frame, modify, copy, distribute, commercialise, sell exploit and/or alter the\r\nWebsite or Content or any part thereof or incorporate any part of the Website or Content in any\r\nother work, content or publication (including on other websites) or use the Website other than in\r\naccordance with these Terms.\r\nAny restrictions on the use of the Website and Content shall apply to any part of the Website\r\nand Content, which may be cached when using same.\r\nYou shall not misrepresent your identity or any other information in any communication or\r\nengagement with us (or our authorised representatives) or during your use of the Website and\r\nContent, including in the course of purchasing our products and/or services.\r\nYou shall not allow a third party to decompile, disassemble or otherwise reverse engineer or\r\nattempt to reconstruct or discover any source code, underlying ideas, algorithms, file formats,\r\nprogramming of the software forming part of the Website or any files contained in or generated\r\nby the software by any means whatever.\r\n\r\nIntellectual Property Rights\r\nThe Website and Content are owned by us and protected under both South African and foreign\r\nlaws. We grant you a non-exclusive, worldwide, non-transferrable licence to use the Website for\r\npersonal, non-commercial use only which may be revoked by us at any time in our sole\r\ndiscretion.\r\nYou agree that you will not engage in the use or distribution of the Website and/or Content (or\r\nany part thereof) other than as expressly permitted herein. For the avoidance of doubt, you must\r\nobtain our written permission before you share any of our Content with anyone else or use it for\r\nany purpose and in any manner save as expressly permitted herein.\r\nAny reproduction, duplication, modification, selling, exploitation, copying, creation of derivative\r\nworks or redistribution of the Website and Content, including the design, graphics and\r\nappearance of the Website and Content is expressly prohibited. Copying, duplication and/or\r\nreproducing the Website and Content or any part thereof to any other server or location for\r\nfurther reproduction, redistribution and/or selling is also expressly prohibited.\r\nYou agree not to circumvent, disable or otherwise interfere with security related features of the\r\nWebsite or features that prevent or restrict use or copying or enforce limitations on the use of\r\nthe Website.\r\nNothing on the Websites should be construed as granting to you, by implication, or otherwise,\r\nany license or right to use any trademarks (whether registered or not), tagline or logo, without\r\nour prior written permission specific for each such use.\r\nWe reserve all intellectual property and other rights not expressly granted herein to the Website,\r\nand Content as well as to any and all marketing material (including promotional\r\ncommunications) created or used by us in connection the Website, Content or our products and\r\nservices.\r\nCollection of Personal Information\r\nWe may collect personal information from you when you log in to our Website, create an\r\naccount on our Website and purchase the products and/or services made available on our\r\nWebsite. By disclosing or submitting your personal information to us, you consent to us\r\ncollecting, processing and storing your personal information for the purposes described in our\r\nPrivacy Policy.\r\nTo find out what kind of personal information we collect and the purposes for which your\r\npersonal information will be used, please read our Privacy Policy which can be found on the\r\nWebsite.\r\nConfidential Information\r\nPlease do not email us confidential information (or disclose the confidential parts of your\r\ncommunication) as all emails and communications sent by you to us including but not limited to\r\nquestions, ideas, concepts, comments, feedback, suggestions and the like may be used by us\r\nin the development, promotion and marketing of our Website, Content, products and services,\r\nor for any other purpose whatsoever without compensation or accreditation to you.\r\nExternal Websites\r\nThe Website and Content may contain links to third party websites (\"External Websites\").\r\nThese links are provided as is and for your convenience only and are not an endorsement by\r\nus of the content, information or views expressed thereon.\r\nIf you link to External Websites, you will be subject to those External Websites terms and\r\nconditions, privacy and other policies, therefore we advise and recommend that you review and\r\ncomply therewith. We do not take any responsibility for the content and information that appears\r\non External Websites (even if our Website or Content is linked thereon), nor do we accept\r\nliability for any damage or loss of any nature whatsoever and howsoever arising from your use\r\nof such External Websites, which use is at your own risk.\r\nYou agree that we cannot be liable for any illegal, offensive or defamatory communication,\r\ninformation or content on any External Websites or any behaviour associated or in connection\r\ntherewith.\r\nThe provisions below ((1) Indemnity and Limitation of Liability, (2) Exclusion of\r\nWarranties and Representation and (3) Accuracy of Information) constitute an\r\nassumption of risk and/or liability by you and limits and excludes liabilities, obligations\r\nand legal responsibility, which we will have towards you and other persons. These\r\nprovisions also limit and exclude your rights and remedies against us and place various\r\nrisks, liabilities, obligations and legal responsibilities on you. Please ensure that you\r\nhave read and understood these provisions.\r\nIndemnity and Limitation of Liability\r\nNeither us nor any of our agents, officers, subsidiaries, affiliates, partners, successors, assigns,\r\ndirectors, shareholders, group companies, service providers, distributors, contractors, suppliers,\r\nemployees or representatives (Ancillary Parties) are responsible for your actions or\r\nomissions arising out of or in connection with your use of the Website and Content.\r\nTo the fullest extent permitted by law, you agree to defend, indemnify us and hold us and our\r\nAncillary Parties harmless from and against any and all claims, actions, applications, demands,\r\ndirect, indirect, incidental, special and/or consequential loss and/or damage (including but\r\nnot limited to loss of income, revenue, profits, savings, business, time and goodwill), and all\r\nliabilities, costs, debts, and expenses (including professional and attorney fees) whether caused\r\nby negligence, breach of contract or otherwise, arising out of or in connection with:\r\ni) your use of and access to the Website and Content;\r\nii) your use of any External Websites or services linked thereto whether linked on the\r\nWebsite, in our Content or otherwise;\r\niii) your inability (for any reason whatsoever including but not limited to security breaches,\r\noperational delays, computer viruses, system and other updates and minimum order\r\nrequirements) to use and access the Website and/or purchase the products and services\r\nmade available thereon;\r\niv) your violation or breach of any of these Terms, any documents incorporated herein by\r\nreference or our Privacy Policy;\r\nv) the unauthorised use, access to or theft of your personal information and/or data and/or\r\nthe personal information and/or data of your customers;\r\nvi) the unauthorised use of your account or any password protected Content;\r\nvii) your violation of any third party right, including without limitation any copyright,\r\ntrademark, trade secret or other intellectual property or privacy right; and\r\nviii) any claim that the Website and/or Content caused damage to a third party.\r\nTo the extent permitted by law:\r\ni) our total liability and the total liability of our Ancillary Parties shall be limited to the amount\r\nof R100 (one hundred Rand), save where you purchase any of the products and/or services\r\nmade available on the Website, in which case our total liability and the total liability of our\r\nAncillary Parties shall be limited to the amount you paid to us for products and/or services\r\npurchased;\r\nii) all indemnities and limitations of liability in these Terms shall survive termination,\r\nmodification or expiration of these Terms and termination of your use of the Website.\r\nNo provision of these Terms:\r\ni) does or purports to limit or exempt us from any liability to the extent that the law does not\r\nallow such a limitation or exemption; and\r\nii) requires you to assume risk or liability, to the extent that the law does not allow such an\r\nassumption of risk or liability.\r\nExclusion of Warranties and Representations\r\nAs far as the law allows, the Website and Content are made available without any\r\nrepresentation or warranty whatsoever, whether express, implied or statutory, including without\r\nlimitation any representation or warranty as to the operation, accuracy, quality, integrity,\r\ncompatibility, completeness, correctness, good-use, availability, performance, fitness for a\r\nparticular purpose, merchantability, reliability or functionality.\r\nFurther, we do not warrant or represent:\r\n(i) the security of any information provided, submitted or transmitted to or from us through the\r\nWebsite or otherwise;\r\n(ii) the Website and Content will be error, omission or virus free or that your access will be\r\nuninterrupted and error free; and\r\n(iii) that you will attain any particular result from your use or non-use of the Website and\r\nContent.\r\nAccuracy of Information\r\nYou understand and agree that the information provided on or through the Website and Content\r\nincluding the details regarding prices, offers, products and services may change from time to\r\ntime. The Website and Content may therefore not always contain the correct or most up-to-date\r\ninformation, details and descriptions.\r\nWhile reasonable effort has been made to ensure the accuracy of the information provided on or\r\nthrough the Website and Content, we do not guarantee the accuracy of such information or that\r\nthe information is current and applicable to you. You acknowledge that the Website, and\r\nContent may contain technical, typographical or other inaccuracies or errors for which we shall\r\nnot to the fullest extent permitted by law be liable for.\r\nWe reserve the right to make changes, corrections, updates and/or improvements to the\r\nWebsite and Content at any time without notice.\r\nProtected Content\r\nCertain Content, information and features of our Website may be password protected. You\r\nagree to keep user details and passwords for your account confidential at all times and to not\r\ndisclose them to any third party. Our right to terminate your access to any password protected\r\ninformation and Content is strictly reserved and can be exercised by us immediately upon\r\nbecoming aware that you have shared your username and/or password with a third party.\r\nYou shall notify us immediately if you become aware of any unauthorised use of your account\r\nand shall indemnify us against any and all claims, actions, applications, demands, losses and/or\r\ndamages (whether direct, indirect, special and/or consequential), costs and expenses (including\r\nprofessional fees) and any other liability, which arises from any unauthorised use of your\r\naccount.\r\nAssignment\r\nThese Terms, and any rights and licenses granted hereunder, may not be transferred or\r\nassigned by you, but may be assigned by us without restriction. Any assignment or transfer by\r\nyou shall be null and void.\r\n\r\nTermination\r\nWe reserve the right to terminate your access to the Website and Content at any time, for any\r\nreason, without notice. To the extent permitted by law, your obligations under these Terms shall\r\nsurvive termination of your access to the Website and Content.\r\nViolation of Terms\r\nPlease report any violations of these Terms including any documents incorporated herein by\r\nreference that you become aware of by contacting us at info@mnandiretail.com\r\nAny failure to act by us with respect to a breach by you or others does not waive our right to act\r\nwith respect to subsequent or similar breaches by you or others.\r\nInterpretation and Dispute Resolution\r\nThese Terms including any documents incorporated by reference and the relationship between\r\nus and you shall be governed and construed in accordance with the laws of the Republic of\r\nSouth Africa.\r\nYou agree to notify us of any issues or dissatisfaction that arises via e-mail correspondence\r\nprior to taking any legal action. Should we be unable to seek resolution within a reasonable\r\ntime, you agree that the dispute shall be finally resolved through arbitration, before a single\r\narbitrator, in accordance with the Arbitration Act, 1965 and the Commercial Arbitration Rules of\r\nthe Arbitration Foundation of South Africa.\r\nWe shall jointly appoint and agree on the arbitrator but failing agreement between us within 10\r\n(ten) business days of the arbitration being demanded, we shall appoint the arbitrator in our sole\r\ndiscretion.\r\nThe arbitration shall be held in Johannesburg, South Africa and the parties shall endeavor to\r\nensure that it is completed as expediently as possible without delay after notice requiring the\r\ndispute to be referred to arbitration is given or demanded.\r\nYou agree that you shall not unduly delay, frustrate or fail to take action to progress or complete\r\nthe arbitration proceedings. The arbitrator shall have the power to give default judgement if any\r\nparty fails to make submissions on due date and/or fails to appear at the arbitration.\r\n\r\nThe ruling of the arbitrator, in the absence of manifest error, shall be final and binding on the\r\nparties and the party in whose favour the award is granted shall be entitled to all reasonable\r\nfees (including attorney fees) and the costs necessary to enforce the decision of the arbitrator.\r\nIn the event of a dispute, you agree not to engage in or be responsible for any defamatory,\r\nharmful, negative or disruptive behaviour or communications, whether private or public that\r\ncould adversely affect us, our business, Website, Content or good will in any manner\r\nwhatsoever.\r\nOur failure to exercise or enforce any right or provision of these Terms shall not constitute a\r\nwaiver of such right or provision, nor will it affect any of our accrued rights or liabilities nor the\r\ncoming into or continuance in force of any provision of these Terms which is expressly or by\r\nimplication intended to come into or continue in force on or after termination of these Terms.\r\nIf any provision of these Terms is or becomes illegal, invalid or unenforceable such provisions\r\nshall be ineffective to the extent of such prohibition or unenforceability and shall be treated as\r\nhaving not been written and severed from the balance of these Terms, without invalidating the\r\nremaining provisions of these Terms.\r\nHow to contact us\r\nIf you have questions about these Terms, or any documents incorporated herein by reference,\r\nplease contact us at info@mnandiretail.com\r\nLast updated 2021/03/23\r\n', 0, 0, '2021-03-23 05:39:37');
