amily:\"Arial\",sans-serif;\'><span style=\"color:black;\">&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">&nbsp;</span></p>\r\n<p style=\'margin-top:12.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:1.0cm;text-align:justify;text-indent:-1.0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"color:black;\">Accuracy of Information</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">You understand and agree that the information provided on or through the Website and Content including the details regarding prices, offers, products and services may change from time to time.</span><span style=\"color:black;\">&nbsp;</span><span style=\"color:black;\">The Website and Content may therefore not always contain the correct or most up-to-date information, details and descriptions.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">While reasonable effort has been made to ensure the&nbsp;</span><span style=\"color:black;\">accuracy of the information provided on or through the Website and Content,</span><span style=\"color:black;\">&nbsp;</span><span style=\"color:black;\">we</span><span style=\"color:black;\">&nbsp;do not guarantee the accuracy of such information or that the information is current and applicable to you. You acknowledge that the Website, and Content may contain technical, typographical or other inaccuracies or errors for which we shall not to the fullest extent permitted by law be liable for.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">We reserve the right to make changes, corrections, updates and/or improvements to the Website and Content at any time without notice.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><strong><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;color:black;\'>Protected Content</span></strong></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">Certain Content, information and features of our Website may be password protected.&nbsp;</span><span style=\"line-height:150%;color:black;\">You agree to keep user details and passwords for your account confidential at all times and to not disclose them to any third party. Our right to terminate your access to any password protected information and Content is strictly reserved and can be exercised by us immediately upon becoming aware that you have shared your username and/or password with a third party.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">You shall notify us immediately if you become aware of any unauthorised use of your account and shall indemnify us against any and all claims, actions, applications, demands, losses and/or damages (whether direct, indirect, special and/or consequential), costs and expenses (including professional fees) and any other liability, which arises from any unauthorised use of your account.&nbsp;</span></p>\r\n<p style=\'margin-top:12.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"color:black;\">Assignment&nbsp;</span></p>\r\n<p style=\'margin-top:12.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"color:black;font-weight:normal;\">These Terms, and any rights and licenses granted hereunder, may not be transferred or assigned by you, but may be assigned by us without restriction. Any assignment or transfer by you shall be null and void.</span></p>\r\n<p style=\'margin-top:12.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"color:black;\">Termination&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">We reserve the right to terminate your access to the Website and Content at any time, for any reason, without notice. To the extent permitted by law, your obligations under these Terms shall survive termination of your access to the Website and Content.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"line-height:150%;color:black;\">Violation of Terms</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">Please report any violations of these Terms including any documents incorporated herein by reference that you become aware of by contacting us at&nbsp;</span><span style=\"line-height:150%;color:black;\"><a href=\"mailto:info@mnandiretail.com\">info@mnandiretail.com</a></span><span style=\"color:black;\">&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">Any failure to act by us with respect to a breach by you or others does not waive our right to act with respect to subsequent or similar breaches by you or others. &nbsp;</span></p>\r\n<p style=\'margin-top:12.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"color:black;\">Interpretation and Dispute Resolution</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">These Terms including any documents incorporated by reference and the relationship between us and you shall be governed and construed in accordance with the laws of the Republic of South Africa.&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">You agree&nbsp;</span><span style=\"line-height:150%;color:black;background:white;\">to notify us of any issues or dissatisfaction that arises via e-mail correspondence prior to taking any legal action. Should we be unable to seek resolution within a reasonable time, you agree that the dispute shall be finally resolved through arbitration, before a single arbitrator, in accordance with the</span><span style=\"line-height:150%;color:black;\">&nbsp;</span><span style=\"line-height:150%;color:black;background:white;\">Arbitration Act, 1965 and the Commercial Arbitration Rules of the Arbitration Foundation of South Africa</span><span style=\"line-height:150%;color:black;\">.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">We shall jointly appoint and agree on the arbitrator but failing agreement between us within 10 (ten) business days of the arbitration being demanded, we shall appoint the arbitrator in our sole discretion.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">The arbitration shall be held in Johannesburg, South Africa and the parties shall endeavor to ensure that it is completed as expediently as possible without delay after notice requiring the dispute to be referred to arbitration is given or demanded.&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">You agree that you shall not unduly delay, frustrate or fail to take action to progress or complete the arbitration proceedings.&nbsp;</span><span style=\"line-height:150%;color:black;\">The arbitrator shall have the power to give default judgement if any party fails to make submissions on due date and/or fails to appear at the arbitration.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">The ruling of the arbitrator, in the absence of manifest error, shall be final and binding on the parties and the party in whose favour the award is granted&nbsp;</span><span style=\"line-height:150%;color:black;background:white;\">shall be entitled to all reasonable fees (including attorney fees) and the costs necessary to enforce the decision of the arbitrator.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">In the event of a dispute, you agree not to engage in or be responsible for any defamatory, harmful, negative or disruptive behaviour or communications, whether private or public that could adversely affect us, our business, Website, Content or good will in any manner whatsoever. &nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"line-height:150%;color:black;\">Our failure to exercise or enforce any right or provision of these Terms shall not constitute a waiver of such right or provision, nor will it</span><span style=\"line-height:150%;color:black;\">&nbsp;affect any of our accrued rights or liabilities nor the coming into or continuance in force of any provision of these Terms which is expressly or by implication intended to come into or continue in force on or after termination of these Terms.&nbsp;</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">If any&nbsp;</span><span style=\"color:black;\">provision of these Terms is or becomes illegal, invalid or unenforceable such provisions shall be ineffective to the extent of such prohibition or unenforceability and shall be treated as having not been written and severed from the balance of these Terms, without invalidating the remaining provisions of these Terms.</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;text-indent:0cm;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;font-weight:bold;\'><span style=\"line-height:150%;color:black;\">How to contact us</span></p>\r\n<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:12.0pt;margin-left:0cm;text-align:justify;line-height:150%;font-size:15px;font-family:\"Arial\",sans-serif;\'><span style=\"color:black;\">If you have questions about these Terms, or any documents incorporated herein by reference, please contact us at&nbsp;</span><span style=\"line-height:150%;color:black;\"><a href=\"mailto:info@mnandiretail.com\">info@mnandiretail.com</a>&nbsp;</span></p>\r\n<p style=\'margin:0cm;font-size:15px;font-family:\"Arial\",sans-serif;line-height:150%;\'><span style=\"color:black;\">Last updated 2021/03/23</span></p>', 0, 0, '2021-03-26 05:42:32');
INSERT INTO `pageapp` (`id`, `pg_title`, `pg_slug`, `pg_descri`, `pg_status`, `pg_foot`, `crated_date`) VALUES
(4, 'Policy', 'policy', '<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Please read this Privacy Policy carefully before using this website as your use of this website for any reason whatsoever will mean that you have voluntarily agreed to be legally bound by the terms and conditions contained in this Privacy Policy.&nbsp;</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Introduction</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Thank you for visiting the website www.mnandisolutions.com (&quot;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>Website</span></strong>&quot;) or any other website/application hosted by Mnandi Retail Solutions. The Website is made available by&nbsp;</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Mnandi Retail Solutions (Pty) Limited&nbsp;</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>(&quot;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>we</span></strong>&quot; or &quot;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>us</span></strong>&quot; or &quot;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>our</span></strong>&quot;)<strong><span style=\'font-family:\"Arial\",sans-serif;\'>&nbsp;</span></strong>and we are committed to protecting and respecting your privacy.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>This Privacy Policy sets out the basis on which any personal information&nbsp;</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>(as defined in the Protection of Personal Information Act 4 of 2013</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>&nbsp;</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>(&ldquo;<strong>POPI</strong>&rdquo;)) (&ldquo;<strong>Personal Information</strong>&rdquo;) we collect from you, or that you provide to us, will be used, stored and processed by us. &nbsp;Please read the following carefully to understand our views and practices regarding your Personal Information and how we will treat it.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:15px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:150%;\'><span style=\"line-height:150%;\">In adopting this Privacy Policy, we wish to balance our legitimate business interests and your reasonable expectation of privacy. &nbsp;Accordingly, we will take all appropriate, reasonable, technical and organisational measures to prevent unauthorised access to, or disclosure of your Personal Information. &nbsp;However, as no security system is impenetrable, we cannot guarantee and do represent or warrant that your Personal Information will be one hundred percent secure or that the information you supply (including information contained in electronic messages and/or emails sent to or from the Website and/or any contact email address on the Website) will not be intercepted while being transmitted to and from us over the Internet.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:15px;font-family:\"Arial\",sans-serif;margin-top:0cm;margin-bottom:12.0pt;text-align:justify;text-indent:0cm;line-height:150%;\'><span style=\"line-height:150%;\">You agree that we may collect, process and store &nbsp;your Personal Information (&quot;<strong>Collect</strong>&quot;) for the purposes of providing you with access to our Website, content, products and/or services and the products and/or services of our suppliers, affiliates and selected third parties</span><span style=\"line-height:150%;\">&nbsp;(&ldquo;<strong>Product Companies</strong>&rdquo;)</span><span style=\"line-height:150%;\">, &nbsp;and for any of the purposes described herein.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Types Of Personal Information We Collect</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>The types of Personal Information that we may collect include information necessary for our legitimate business interests and the types of Personal Information specified in POPI such as your first and last name, email address, billing information (including address, debit or credit card information and any other information required to complete a purchase), contact information and address information.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;margin-bottom:3.0pt;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Should you distribute our products and elect to make use of our e-wallet payment system, we may as a result of your use thereof Collect Personal Information of your customers. Should you elect to use our e-wallet payment system to process or collect payments from your customers or for any reason whatsoever, you undertake to:</span></p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n    <li><span style=\"line-height:150%;font-weight:normal;font-size:15px;\">obtain the prior written consent of your customers to the collection, storing and processing of their Personal Information by us;</span></li>\r\n    <li><span style=\"line-height:150%;font-weight:normal;font-family:Arial;font-size:15px;\">comply&nbsp;</span><span style=\"line-height:150%;font-weight:normal;font-size:15px;\">with POPI and all local data protection laws, regulations, policies and/or codes (&ldquo;</span><span style=\"line-height:150%;font-size:15px;\">Data Laws</span><span style=\"line-height:150%;font-weight:normal;font-size:15px;\">&rdquo;), that may be enacted from time to time, and put in place and maintain sufficient measures, policies and systems to comply with such Data Laws; and</span></li>\r\n    <li><span style=\"line-height:110%;font-weight:normal;\">implement technical and organisational security measures before processing Personal Information; and&nbsp;</span></li>\r\n    <li><span style=\"line-height:110%;font-weight:normal;font-family:Arial;font-size:15px;\">deal promptly with all inquiries from us relating to the Personal Information of your customers that we Collect.</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>When you visit our Website, our web server automatically records the name of your ISP (Internet Service Provider), the website from which you visit us, the pages on our Website you visit and in what sequence, and the date and length of your visit. This information is aggregate and anonymous data and does not identify you specifically. We may share this data for marketing purposes.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>How Your Personal Information Is Used</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>We may Collect and use your Personal Information to:</span></p>\r\n<ol style=\"list-style-type: undefined;margin-left:29px;\">\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>inform you of changes made to our Website, content, products and/or services and/or the products and/or services of our Product Companies.</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>inform you of changes made to our Terms and Conditions, Privacy Policy, Terms of Purchase, Returns Policy and any other documents and/or agreements incorporated therein by reference (&ldquo;<strong>Legal Agreements</strong>&rdquo;);</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>market our products and/or services to you and the products and/or services of our Product Companies.</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>send you correspondence (if you subscribed to our email list) and respond to any queries you may have.</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>determine and understand your specific customer needs and desires in order to improve our content, Website, and the products and services made available thereon.</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>conduct security, administrative and legal processes and for purposes ancillary thereto.&nbsp;</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>deliver the products and services made available for purchase on the Website to you.&nbsp;</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>process payments when you purchase the products and/or services made available on the Website.&nbsp;</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>process payments of your customers should you elect to make use of our e-wallet payment system; and</span></li>\r\n    <li><span style=\'line-height:150%;font-family:\"Arial\",sans-serif;font-size:15px;\'>create your customer profile and/or account on our Website.</span></li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Our Cookies Policy</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>We and our third-party service providers may send &quot;cookies&quot; to your computer or use similar technologies to enhance your online experience at our Website and across the Internet. &quot;Cookies&quot; are files that can identify you as a unique customer and store your personal preferences as product preferences to tell us which Website pages you have visited and in what order. We use cookies and other technical information to personalize your visit to our Website, to analyse traffic on our Website and to track user trends, patterns and selections for authorised download and for technical reasons connected with your use of our Website.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>On their own, cookies do not contain or reveal any Personal Information, nor do we set any personally identifiable information in cookies, however, if you choose to provide us with Personal Information, it can be linked to the anonymous data stored in the cookies. Most browsers are initially set to accept cookies, however, if you prefer, you may adjust your browser to reject cookies from us or from any other website. Please note that this may prevent you accessing certain areas and features of our Website, content, products and services.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Personal Information That Is Publicly Available</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>You agree that Personal Information made available by you for viewing by others on or through our Website, social media pages or other websites (&ldquo;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>Online Platforms</span></strong>&rdquo;) can be used and stored by others. We may collect the Personal Information that you disclose, however, we cannot be liable for the use, security, storage or improper use of such Personal Information you voluntarily post on Online Platforms.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Storage And Processing Of Personal Information</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>By using our Website, you agree that we may Collect your Personal Information for the purposes set out in this Privacy Policy.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Should you have or create an account on or through our Website or subscribed to our email list, your Personal Information may be processed by us using our enterprise resource planning (&ldquo;ERP&rdquo;) software or should we elect in our sole discretion, a third-party operator which stores your Personal Information in a customer relationship management (&ldquo;<strong>CRM</strong>&rdquo;) system.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>We will not store your Personal Information for longer than is necessary, unless it is lawful for us to do so.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Should a breach of your Personal Information occur, we will timeously inform you (and the Information Regulator) of such breach and provide you with as much information as we have available in relation thereto in order to allow you to take any necessary protective measures.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Confidentiality And Disclosure Of Information</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>We will take appropriate measures to ensure your Personal Information is kept confidential, however you understand that to balance our legitimate business interests we may share your Personal Information with:</span></p>\r\n<ol start=\"9\" style=\"list-style-type: lower-alpha;margin-left:60px;\">\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>our authorised employees, contractors, service providers, representatives and/or agents who have a legitimate need to know your Personal Information (&ldquo;<strong>Agents</strong>&rdquo;);</span></li>\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>our Product Companies and their Agents;</span></li>\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>any entity that directly or indirectly controls Mnandi Retail Solutions (Pty) Ltd and their Agents. For the purposes of the foregoing, &ldquo;control&rdquo;, means the ownership directly or indirectly of more than forty (40) per cent of the voting rights in a juristic person.</span></li>\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>our CRM service provider, third party payment processors and&nbsp;</span><span style=\"line-height:115%;font-size:15px;\">financial service providers</span><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>.</span></li>\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>social media and marketing websites or platforms, including Google, Facebook, Instagram, LinkedIn, Twitter and the like for purposes of advertising our content, products and/or services and the products and/or services of our Product Companies;</span></li>\r\n    <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>regulators, auditors, legal advisors, other professionals and affected parties in order to:</span>\r\n        <ol style=\"list-style-type: lower-alpha;\">\r\n            <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>obtain professional advice;</span></li>\r\n            <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>comply with applicable laws and regulations (as amended from time to time); and</span></li>\r\n            <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>protect our rights, including our rights under our Legal Agreements (including the investigation of a perceived breach of our Legal Agreements); and</span></li>\r\n            <li><span style=\'line-height:115%;font-family:\"Arial\",sans-serif;font-size:15px;\'>protect the rights of the users of our Website and purchasers of our products and/or services made available on the Website and under our Legal Agreements.</span></li>\r\n        </ol>\r\n    </li>\r\n</ol>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>We may share information about users of our Website and/or Online Platforms in an anonymous or aggregate form with third parties including advertisers and business partners, to understand customer trends and patterns and manage and improve our business relationships.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Third Party Websites</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Please note that if you click on, or follow, any links from our Website to third party websites, our Privacy Policy will no longer apply. Please check the privacy policies of any such third party websites before submitting any Personal Information or other data, as we cannot accept any responsibility or liability in relation to such third party websites.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Access To Information And Data Subject Rights</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Subject to the conditions in POPI, you have the right to (1) know what Personal Information we have collected from/about you,(2) have your Personal Information permanently deleted or detroyed, (3)&nbsp;</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>object to the processing of your Personal Information at any time, on reasonable grounds (including if the processing is for purposes of direct marketing (other than direct marketing by means of unsolicited electronic communications and you have not given your consent thereto))</span><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>, (4) correct or update your Personal Information, (5) withdraw consent you have previously given us to process your Personal Information, and (6) lodge a complaint with the Information Regulator if you think your Personal Information is being used unlawfully (&ldquo;<strong><span style=\'font-family:\"Arial\",sans-serif;\'>Data Rights</span></strong>&rdquo;).</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>To exercise your Data Rights please email us at info@mnandiretail.com In addition, we will always give you the opportunity to unsubscribe from our email list in all of our email communication with you.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Changes To This Privacy Policy</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>From time to time, we may revise this Privacy Policy to reflect company initiatives, changes in the law or technology or changes in our practices regarding the collection, use, storage and processing of Personal Information. If we decide to change this Privacy Policy, the changes will be posted on our Website (and be effective immediately) so that you are always informed of the latest version.&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Please review our Privacy Policy each time you visit our Website to ensure that you are aware of all updates and changes that are made.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Protection Of Minors</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>To use and access our Website and/or purchase the products and/or services made available on the Website you must be 18 (eighteen) years or older. Accordingly, we do not knowingly collect any information or data from children under the age of 18 (eighteen). If you are under the age of 18 (eighteen) please do not use our Website or give us any Personal Information.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Enforceability</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>If any provision of this Privacy Policy is judged to be illegal, void or unenforceable it shall be deemed deleted and the continuation in full force and effect of the remainder of the provisions will not be prejudiced.</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><strong><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Contact</span></strong></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>If you have any questions or comments about this Privacy Policy please contact us at info@mnandiretail.com&nbsp;</span></p>\r\n<p style=\'margin-right:0cm;margin-left:0cm;font-size:16px;font-family:\"Cambria\",serif;margin:0cm;line-height:150%;\'><span style=\'font-size:15px;line-height:150%;font-family:\"Arial\",sans-serif;\'>Last Updated 2021/03/23</span></p>', 0, 0, '2021-03-23 05:48:50'),
